import React from "react";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";
import quizOneBackground from "../visuals/quiz/q1_background.mp4";
import title from "../visuals/quiz/q3/title.png";

export default function QuestionThree() {
  return (
    <div className="questionContainer">
      <ReactPlayer
        className="react-player quiz-video"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />

      <div className="questionThree_container">
        <img src={title} className="q3_title" alt="" />

        <div className="row">
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
        <div className="row">
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
        <div className="row">
          {" "}
          <h1>slow</h1>
          <h1>exhale</h1>
          <h1>fast</h1>
        </div>
      </div>
      <Link to="/question-four">Room four </Link>
    </div>
  );
}
